// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import { faUser } from '@fortawesome/free-solid-svg-icons';


const root = createRoot(document.getElementById("root"));
root.render(
    <React.StrictMode>
        <App />
